    useEffect(()=>{
        (async function (){
            return (await getTemps());
        })()
    }, [getTemps])

    const filterCans = ({target: {value}})=>{
        filterBy(value)
    }
    return (
        <div>
            <form action="">
            <label>
                Base de datos
           <input type="radio" onChange={filterCans} name="filter" value="MY_CANS" />
            </label>
