               Api de perros
           <input type="radio" onChange={filterCans} name="filter" value="API_DOGS" />
            </label>
            <select name="" id="">
                {temps.map((temp, i) => {

                })}
            </select>
            </form>
        </div>
    )
}

const mapStateToProps = ({temps})=>({temps})

export default connect(mapStateToProps, {filterBy, getTemps})(Filter)
